import React, { Component } from "react";

class HomePage extends Component {


    roteSignUp = (e) => {
        this.props.history.push({
            pathname: '/sign-up',
        });
    }

    render() {
        return (
            <div class="div-home-page">
             <svg width="580" height="400" xmlns="http://www.w3.org/2000/svg">
 <g>
  <title>Layer 1</title>
  <path id="svg_6" d="m-0.5,-0.5625c128,271 125,301 124.5,300.5625c0.5,0.4375 -122.5,96.4375 -123,96c0.5,0.4375 -129.5,-667.5625 -1.5,-396.5625z" stroke-opacity="null" stroke-width="1.5" stroke="#000" fill="#0E353B"/>
 </g>
</svg>
                <svg viewbox="0 0 50 50" height="56px">
                    <path d="M1 50 V10 Q1 1 10 1 H50z" fill="#ff4369" />
                </svg>
                <div>
                    <h1 class="title-home-page title-color">Central</h1>
                    <h2 class="sub-title-home-page title-color">de</h2>
                    <h1 class="title-home-page title-color">Erros</h1>

                </div>
                <div class="background-home-page background-color-orange">
                </div>
            </div>


        );
    }
}

export default HomePage;
